import React from 'react';
import Nav from '../nav/Nav';
import Shelf from '../shelf/Shelf';
import SideBar from '../sideBar/SideBar';
const KeyContent = () => {
    return (
        <>
            <Nav />
            <Shelf />
            <SideBar />
        </>
    );
}

export default KeyContent;
